SELECT * FROM PSTParserAFS (
  ON empty_table
  USING
  Path ('/test/dum1.pst')
) AS dt;

SELECT input_path, sender, "to" FROM PSTParserAFS (
  ON empty_table
  USING
  Path ('/test/dum1.pst')
  OutputColumns ('input_path', 'to')
) AS dt;

SELECT * FROM PSTParserAFS (
  ON empty_table
  USING
  Path ('/test/')
  Exclude ('Drafts', 'Deleted Items', 'Notes', 'Sent Items')
) AS dt;

SELECT * FROM PSTParserAFS (
  ON empty_table
  USING
  Path ('/test[1-9]/[a-z]*')
  Exclude ('Sent I[a-z]*/2012/[a-z]')
) AS dt;
